window.bookSummaryJSON = "<p>Matti would prefer never to see her vindictive dwarven aunt ever again. All she wants is to find her missing parents.</p> <p>But her aunt is extorting the elven assassin, Sarrlevi. That would be problematic on its own, but he’s become Matti’s biggest ally and the man—the <i>elf</i>—she’s falling in love with.</p> <p>To save her family, Matti must find a way to help Sarrlevi before he strikes the most devastating blow of all.</p>"; 
